
--Creating Database

CREATE DATABASE pizzasales_db;

--Creating Tables and Columnns

CREATE TABLE pizzas (
	pizza_id SERIAL PRIMARY KEY,
	pizza_code TEXT UNIQUE,
	name TEXT NOT NULL,
	category TEXT NOT NULL,
	ingredients TEXT
);


CREATE TABLE pizza_type (
	pizza_typeid SERIAL PRIMARY KEY,
	pizza_typecode TEXT NOT NULL,
	pizza_id INT REFERENCES pizzas (pizza_id),
	pizza_code TEXT NOT NULL,
	size TEXT NOT NULL,
	price NUMERIC CHECK ( price > 0 )
);



CREATE TABLE orders (
	order_id SERIAL PRIMARY KEY,
	date DATE NOT NULL,
	time TIME NOT NULL
);


CREATE TABLE order_details (
	order_details_id SERIAL PRIMARY KEY,
	order_id INT NOT NULL,
	pizza_typecode TEXT NOT NULL,
	quantity INT CHECK ( quantity > 0 ),
	pizza_typeid INT REFERENCES pizza_type (pizza_typeid),	
	FOREIGN KEY (order_id) REFERENCES orders (order_id)
);

--DML Queries

SELECT * FROM pizzas;
SELECT * FROM pizza_type;
SELECT * FROM orders;
SELECT * FROM order_details;


